module.exports = (api) => {
  const env = api.env();

  let dev = false;
  let setUseClient = false;
  let modules;

  switch (env) {
    case 'docs':
    case 'test':
    case 'dist-dev':
      dev = true;
      modules = false;
      break;
    case 'dist-prod':
      modules = false;
      break;
    case 'esm':
      modules = false;
      setUseClient = true;
      break;
    case 'cjs':
    default:
      modules = 'commonjs';
      setUseClient = true;
      break;
  }

  return {
    presets: [
      [
        '@react-bootstrap',
        {
          dev,
          modules,
          removePropTypes: !dev,
          setUseClient,
          customClientImports: ['useBootstrapPrefix', 'createWithBsPrefix'],
        },
      ],
      '@babel/preset-typescript',
    ],
    plugins: [env === 'test' && 'istanbul'].filter(Boolean),
  };
};

{
  "extends": [
    "@react-bootstrap",
    "4catalyzer-typescript",
    "prettier"
  ],
  "plugins": [
    "prettier"
  ],
  "rules": {
    "import/extensions": "off",
    "prettier/prettier": "off",
    "react/jsx-uses-react": "off",
    "react/react-in-jsx-scope": "off",
    "react/no-unknown-property": [
      "error",
      {
        "ignore": [
          "x-placement"
        ]
      }
    ],
    "react/function-component-definition": "off"
  },
  "overrides": [
    {
      "files": [
        "test/**/*"
      ],
      "rules": {
        "@typescript-eslint/no-unused-expressions": "off"
      }
    },
    {
      "files": [
        "www/**/*"
      ],
      "rules": {
        "no-console": "off",
        "react/prop-types": "off",
        "react/no-unescaped-entities": "off",
        "no-alert": "off",
        "no-restricted-syntax": "off",
        "no-undef": "off",
        "jsx-a11y/label-has-associated-control": "off"
      }
    },
    {
      "files": [
        "www/docs/examples/**/*"
      ],
      "rules": {
        "import/no-unresolved": "off"
      }
    }
  ]
}

const { DefinePlugin, ProvidePlugin } = require('webpack');

module.exports = (config) => {
  const { env } = process;

  config.set({
    frameworks: ['mocha', 'webpack', 'sinon-chai'],

    files: ['test/index.js'],

    preprocessors: {
      'test/index.js': ['webpack', 'sourcemap'],
    },

    webpack: {
      mode: 'development',
      module: {
        rules: [
          {
            test: /\.[tj]sx?$/,
            exclude: /node_modules/,
            use: {
              loader: 'babel-loader',
              options: {
                cacheDirectory: true,
                envName: 'test',
              },
            },
          },
        ],
      },
      resolve: {
        symlinks: false,
        extensions: ['.js', '.jsx', '.ts', '.tsx'],
        fallback: {
          'process/browser': require.resolve('process/browser'),
        },
      },
      plugins: [
        new DefinePlugin({
          __DEV__: true,
          'process.env.NODE_ENV': JSON.stringify('test'),
        }),
        new ProvidePlugin({
          process: 'process/browser',
        }),
      ],
      devtool: 'inline-cheap-module-source-map',
      stats: 'minimal',
    },

    reporters: ['mocha', 'coverage'],

    mochaReporter: {
      output: 'autowatch',
    },

    coverageReporter: {
      type: 'lcov',
      dir: 'coverage',
    },

    browsers: env.BROWSER ? env.BROWSER.split(',') : ['Chrome'],

    singleRun: env.CONTINUOUS_INTEGRATION === 'true',
  });
};

{
  "extends": ["github>4Catalyzer/renovate-config:library"]
}

{
  "extends": "@4c/tsconfig/web.json",
  "compilerOptions": {
    "rootDir": "src",
    "outDir": "lib",
    "noImplicitAny": false
  },
  "include": ["src"]
}

import { coverageConfigDefaults, defineConfig } from 'vitest/config';
import react from '@vitejs/plugin-react';

export default defineConfig({
  define: {
    // eslint-disable-next-line @typescript-eslint/naming-convention
    __DEV__: true,
  },
  plugins: [react()],
  test: {
    include: ['test/**/*Spec.ts', 'test/**/*Spec.tsx'],
    setupFiles: ['vitest.setup.ts'],
    browser: {
      enabled: true,
      name: 'chromium',
      provider: 'playwright',
      providerOptions: {
        context: {
          hasTouch: true,
        },
      },
    },
    coverage: {
      provider: 'istanbul',
      exclude: [
        ...coverageConfigDefaults.exclude,
        'www/**',
        'tools/**',
        '**/*.js',
      ],
    },
  },
});

import { cleanup } from '@testing-library/react';
import { afterEach } from 'vitest';

afterEach(cleanup);
